        content: 'I. PENDAHULUAN\nMobiledo Yazilim Hizmetleri Limited Sirketi ("Kami," "kami" atau "milik kami") menganggap serius privasi Anda. Kebijakan Privasi ini (“Kebijakan Privasi”) menjelaskan kebijakan perlindungan data kami dan menjelaskan jenis informasi yang dapat kami proses ketika Anda menginstal dan/atau menggunakan aplikasi perangkat lunak untuk perangkat seluler (“aplikasi”, “aplikasi kami”) dan menjelaskan bagaimana kami Dan beberapa perusahaan yang kami kerjakan saat memproses informasi itu.\nKetika kami merujuk pada data pribadi (atau informasi pribadi), kami maksudkan informasi apa pun yang berkaitan dengan orang alami yang dapat diidentifikasi, secara langsung atau tidak langsung, khususnya dengan merujuk pada data tersebut.\nIni adalah orang alami yang dapat diidentifikasi secara langsung atau tidak langsung, khususnya dengan mengacu pada nomor identifikasi atau satu atau lebih faktor khusus untuk status fisik, fisiologis, mental, ekonomi, budaya atau sosialnya.\nKebijakan privasi kami berlaku untuk semua pengguna, dan orang lain yang mengakses aplikasi ("pengguna").\nUntuk keperluan GDPR, kami adalah pengontrol data, kecuali dinyatakan lain.\nHarap baca kebijakan privasi berikut, untuk informasi mengenai cara informasi pribadi Anda dapat diproses, dengan hati -hati. Ketika Anda menggunakan aplikasi, Anda mengakui bahwa Anda telah membaca, memahami, dan setuju untuk terikat oleh Ketentuan ini.\n\nIi. Informasi yang kami proses\nAda dua kategori umum informasi yang dapat kami proses.\nIi.1 Informasi yang Anda kirimkan\nKami memproses informasi pribadi berikut tentang Anda saat Anda menggunakan aplikasi. Informasi ini diperlukan untuk kinerja kontrak yang memadai antara Anda dan kami. Tanpa informasi seperti itu, tidak mungkin untuk memberikan fungsionalitas lengkap dari aplikasi dan melakukan layanan yang diminta.\nInformasi lain yang terkait langsung dengan penggunaan aplikasi Anda, seperti foto dan dokumen yang Anda unggah ke aplikasi. Atas persetujuan Anda, kami juga mungkin memiliki akses ke gulungan kamera Anda.\nIi.2 Informasi yang diproses secara otomatis\nSaat Anda menggunakan aplikasi, beberapa informasi tentang perangkat Anda dan perilaku pengguna Anda dapat diproses secara otomatis. Informasi ini umumnya non-pribadi, yaitu tidak dengan sendirinya, mengizinkan hubungan langsung dengan individu tertentu, dan kami dapat mengaksesnya hanya dalam bentuk agregat. Kami memproses informasi ini dengan alasan minat kami yang sah untuk meningkatkan aplikasi kami dan memberi pengguna kami pengalaman terbaik. Jika kami tidak mengakses data tersebut, kami mungkin tidak dapat memberi Anda semua layanan dan fitur aplikasi yang diminta.\nKami menggunakan teknologi pemrosesan data otomatis pihak ketiga untuk menganalisis informasi tertentu yang dikirim oleh perangkat Anda atau aplikasi kami. Teknologi Pemrosesan Data Otomatis (Alat Periklanan atau Analisis) memberi kami data yang dijelaskan di bawah ini. Kami tidak mengendalikan, mengawasi atau menanggapi bagaimana pihak ketiga memproses data pribadi Anda, yang mungkin dikumpulkan dengan cara mereka sendiri (bukan melalui aplikasi kami). Karena fakta bahwa beberapa pihak ketiga kami menyatakan diri mereka sendiri untuk keperluan GDPR, permintaan informasi apa pun mengenai data pribadi Anda harus diarahkan ke pihak ketiga tersebut.\nInformasi file log. Informasi file log secara otomatis dilaporkan setiap kali Anda membuat permintaan untuk mengakses aplikasi. Ini juga dapat disediakan saat aplikasi diinstal pada perangkat Anda. Saat Anda menggunakan aplikasi kami, alat analitik secara otomatis merekam informasi file log tertentu, termasuk waktu dan tanggal ketika Anda mulai dan berhenti menggunakan aplikasi, dan bagaimana Anda berinteraksi dengan aplikasi. Aplikasi ini dapat menggunakan pemrosesan otomatis data pribadi Anda, termasuk profil, yang berarti segala bentuk pemrosesan otomatis data pribadi yang digunakan untuk mengevaluasi aspek pribadi tertentu yang berkaitan dengan Anda, khususnya untuk menganalisis atau memprediksi aspek tentang preferensi pribadi, minat, perilaku, perilaku Anda lokasi atau gerakan. Memproses informasi melalui teknologi pemrosesan data otomatis dimulai secara otomatis ketika Anda mulai menggunakan aplikasi.\nCookie dan teknologi serupa. Saat Anda menggunakan aplikasi, kami dapat menggunakan cookie dan teknologi serupa seperti piksel, suar web, skrip untuk memproses informasi tentang bagaimana Anda menggunakan aplikasi kami dan memberikan fitur kepada Anda. Cookie adalah file teks yang berisi sejumlah kecil informasi, yang diunduh ke perangkat Anda saat Anda mengakses aplikasi. File teks kemudian dikirim kembali ke server kami setiap kali Anda menggunakan aplikasi. Ini memungkinkan kami untuk mengoperasikan aplikasi secara lebih efektif. Kami menggunakan informasi agregat ini untuk memahami dan mengoptimalkan bagaimana aplikasi kami digunakan, meningkatkan upaya pemasaran kami, dan menyediakan konten dan fitur yang menarik bagi Anda. Kami dapat meminta pengiklan atau mitra lain untuk melayani iklan atau layanan ke aplikasi, yang dapat menggunakan cookie atau teknologi serupa.\n\nAKU AKU AKU. Tujuan memproses data pribadi Anda\nMisi kami adalah terus meningkatkan aplikasi kami dan memberi Anda pengalaman baru. Sebagai bagian dari misi ini, kami menggunakan informasi Anda untuk tujuan berikut:\n(a) Untuk menyediakan layanan kami. Kami menggunakan informasi yang Anda kirimkan dan informasi yang diproses secara otomatis untuk memberi Anda WI'
